import React,{useState,useEffect} from 'react'
import Input from '@material-ui/core/Input'


const BandeauTop = () => {
    
    
    return (  

        <Input 
            defaultValue="Disabled" 
            disabled inputProps={{ 'aria-label': 'description' }} 
        
        />



    );
}
 
export default BandeauTop;
